import Link from 'next/link';
const Header = () => {
    return (
        <header>
            <h1><Link href="/"><a>HB BLog</a></Link></h1>
            <nav>
                <Link href="/about"><a>about</a></Link>
                <Link href="/blog"><a>blog</a></Link>
            </nav>
        </header>
    )
}

export default Header;
